import classes from "./AddUser.module.css";

export default function AddUser(){
    return(
        <form>
            <div>
                <label htmlFor="username" className={classes.input}>Username</label>
                <input type="text" id="username" className={styles.input} />
            </div>
        </form>
    );
}
